script: |
  super -f tsv -I q4350.sql | sort > q4350.out

vector: true

inputs:
  - name: q4350.sql
    data: |
      SELECT - col2 * + col0 AS col0, col0 * + - CAST ( + - 70 AS INTEGER ) AS col2 FROM tab1 AS cor0 WHERE NOT + 5 * + CAST ( - 48 AS INTEGER ) + col1 > - col0;
  - name: tab1

outputs:
  - name: q4350.out
    data: |
      -4896	3570
      -5015	5950
      -6188	6370
